import React from 'react';
import './App.css';
import Navbar from './components/Common/Navbar';
import LocomotiveScroll from 'locomotive-scroll';

function App() {
  const scroll = new LocomotiveScroll({
    el: document.querySelector('[data-scroll-container]'),
    smooth: true
});
  return (
    <body>
      <Navbar/>
      <section id='section1' data-scroll-container data-scroll></section>
      <section id='section2'data-scroll-container data-scroll ></section>
      <section id='section3'data-scroll-container data-scroll data-scroll-speed="2"></section>
      <section id='section4'data-scroll-container data-scroll></section>
      <section id='section5'data-scroll-container data-scroll data-scroll-speed="2"></section>



      <script src='https://cdn.jsdelivr.net/npm/locomotive-scroll@3.5.4/dist/locomotive-scroll.js'></script>
    </body>

  );
}

export default App;
